		Episode = {
			[1] = {EpisodeTitle = _T("灵装夏铃传记1"),Episode = _T("自从听说了水儿生前和北落师门的故事，夏铃终于下定决心开始战斗，而不是继续躲在曹焱兵身后。之后初次出手她便大展神威，和李轩辕互相配合之下，打败了羽林街三灵将之中的天市，成为了一股不可或缺的战力，曹焱兵也因此对她刮目相看。")},--战斗夏铃传记1
			[2] = {EpisodeTitle = _T("灵装夏铃传记2"),Episode = _T("面对非人力所能敌的噬日，在众人被其火力掩盖时，夏铃挺身而出。“大炮多了不起啊！你丫要是卡碧尼！！老娘就是沙扎比！！！”夏铃怒吼着运转全身灵力，身后的冥王破军印尽数迎向噬日的灵气炮，虽然她最后力竭昏迷，但其他人在她的守护下全都安然无恙。")},--战斗夏铃传记2
			[3] = {EpisodeTitle = _T("灵装夏铃传记3"),Episode = _T("夏铃在南无地经历了一场另类的战斗，那便是指挥妖兽果参加凯米拉所组织的斗兽大赛。呆萌的妖兽果要与巨大狰狞的对手战斗，着实让夏铃担心了一番。好在有朱童的秘密武器在，妖兽果得以成功进化，最终打败了面目狰狞的恶兽，获得了斗兽大赛的胜利。")},--战斗夏铃传记3
			[4] = {EpisodeTitle = _T("灵装夏铃传记4"),Episode = _T("群英殿乱战中，夏铃虽然不是主力，但依旧发挥了不可替代的作用。不仅找来了孙斩天这个强力外援，并且与众人一同挖地道潜入了群英殿。并且在伙伴们撤退的必经之路上，夏铃和李轩辕也拼尽全力挡住了卢天佑以及他的守护灵燕青，为众人撤退争取了不少时间。")},--战斗夏铃传记4
			[5] = {EpisodeTitle = _T("灵装夏铃传记5"),Episode = _T("原本是个风华正茂的毕业大学生的夏铃，对自己今后的人生尚无明确的目标，一次误入罗刹街的经历让她觉醒成为高等寄灵人，接着与曹焱兵一起莫名其妙成为了灵域的通缉犯。即使如此，夏铃却毫无怨言，因为她终于找到了自身价值所在，并逐渐在战斗中成长为曹焱兵的左膀右臂。")}--战斗夏铃传记5
		}
	},--战斗夏铃
